window.bookSummaryJSON = "<p><b>The Elemental Magic bundle set includes all six books in the series full of nonstop action, adventure, magic, and irresistible romance.</b></p> <p><b>I thought magic was make believe...but I was </b><b><i>way</i></b><b> wrong.</b></p> <p>I was nobody. No matter how hard I tried, I never fit in with anyone at my high school. Now I know why.</p> <p>Turns out I'm a witch. A scary powerful one, too. Except The Coven that claimed me won't teach me how to use my magic.</p> <p>Suddenly, I'm selected by the Goddess to hunt down a mythical locket needed to save the world from destruction. The only person who actually tries to help me is the alarmingly attractive Tennessee. He has immeasurable power and breathtaking mismatched eyes. I'm drawn to him on a level I can't explain...and he's forbidden from getting too close to me.</p> <p>When the quest takes an unexpected dangerous turn, I have to improvise. This supernatural world is unraveling at my fingertips and I need to master my magic fast. If I don't, I could get everyone I care about killed...</p> <p>Titles include:</p> <ul> <li><i>The Lost Witch</i></li> <li><i>The Brave Witch</i></li> <li><i>The Rebel Witch</i></li> <li><i>The Broken Witch</i></li> <li><i>The Eternal Witch</i></li> <li><i>The Aether Witch</i></li> </ul> <p><b>Featuring a kickass heroine, forbidden love, and magic you’ll wish was real, fans of The Mortal Instruments, Twilight, or Harry Potter will love Chandelle LaVaun’s brand new urban fantasy series!</b></p> <p><b>Thousands of copies sold. Over 500 five-star reviews for the series. Now, for a limited time, save 50 percent compared to buying the individual books by listening to the entire Elemental Magic series in this special bundle deal!</b></p>"; 
